import { changePage, updateOrcamentos } from "./Actions";
import callBackend from "./CallBackend";

export const DeleteOrcamento = () => {
  return async (dispatch, getState) => {
    let token = localStorage.getItem("token");
    let id = getState().orcamentos.atual;
    let cnpj = getState().informacoes.cnpj;
    await callBackend("deleteOrcamento", token, { id }).then(async (r) => {
      await dispatch(updateOrcamentos({ salvos: r.orcamentos }));
      await dispatch(changePage("salvos"));
    });
  };
};
